INSERT INTO `ttopic` VALUES ('8', 'Social Network', 'A social network is a social structure made up of a set of social actors (such as individuals or organizations), sets of dyadic ties, and other social interactions between actors. The social network perspective provides a set of methods for analyzing the structure of whole social entities as well as a variety of theories explaining the patterns observed in these structures.[1] The study of these structures uses social network analysis to identify local and global patterns, locate influential entities, and examine network dynamics.', , ' 182ba88678607ed0d1d3a336cb4fad9fd5dbf13a', '24/11/2017   16:15:35', 'Rajesh', '7');
INSERT INTO `ttopic` VALUES ('9', 'Money Demonetization', 'he Reserve Bank of India said in its annual report on Aug. 30 that 99 percent, or around 15.28 trillion rupees 238.7 billion, of the demonetized 500 and 1,000-rupee notes were deposited or exchanged for new currency. That figure suggests that most people including corrupt officials, businessmen and criminals said to have hoarded their illicit wealth in cash â?? have managed to preserve their fortunes.', , ' 8d807a7018cf1e51f1b3791f1f624c2e7204e158', '24/11/2017   16:19:00', 'Arun', '1');
INSERT INTO `ttopic` VALUES ('10', 'GST', 'The reform process of India indirect tax regime was started in 1986 by Vishwanath Pratap Singh, Finance Minister in Rajiv Gandhiâ??s government, with the introduction of the Modified Value Added Tax (MODVAT). Subsequently, Manmohan Singh, then Finance Minister under of P V Narasimha Rao, initiated early discussions on a Value Added Tax at the state level.A single common Goods and Services Tax GST was proposed and given a go-ahead in 1999 during a meeting between then Prime Minister Atal Bihari Vajpayee and his economic advisory panel, which included three former RBI governors IG Patel, Bimal Jalan and C Rangarajan. Vajpayee set up a committee headed by the then finance minister of West Bengal, Asim Dasgupta to design a GST model', , ' d6d11f54ee487393e03f99b617a2addf8bc1892f', '24/11/2017   16:20:01', 'Arun', '1');
INSERT INTO `ttopic` VALUES ('11', 'Android', 'Android is a mobile operating system developed by Google, based on the Linux kernel and designed primarily for touchscreen mobile devices such as smartphones and tablets.', , ' 1928f95c598b9e69462fcb512625cf8e28923044', '24/11/2017   16:45:39', 'Kiran', '2');
